import React from 'react';
import './index.css';
import './styles.css'

export default function ListingAd({ pic, title, address, description, psf_min,  psf_max }) {
  return (
    <div className="App">
      <img className="" src={pic} />
      <div className='p-5'>
        <div className='flex flex-row'>
            <div className='flex flex-col text-start ml-4'>
            <img src={pic} style={{height: 40, width: 40}}/>

              <div className='font-bold'>{title}</div>
              <div>{address}</div>
            </div>
            <div className=''>
              {psf_max}
            </div>
        </div>
      </div>
    </div>
  );
}
